import React from "react";
import ReactDOMClient from "react-dom/client";
import "./css/main.css";

class Program extends React.Component {
  state = {
    textInput: "",
  };
  render() {
    return (
      <form>
        <input type="text"></input>
        <br />
        <br />
        <button onClick={this.Metod} type="submit">
          Enter
        </button>
      </form>
    );
  }
  Metod = () => {
    this.setState({ textInput: this.input.value });
    return console.log(this.textInput);
  };
}
export default Program;

const link = ReactDOMClient.createRoot(document.getElementById("test"));
link.render(<Program />);
